import {useState, useEffect} from 'react'

export const ShopView = () => {
    const [starwarsData, setStarwarsData] = useState()

    const getDataFromStarWarsAPI = () => {
        return (
            Axios.get('https://swapi.dev/api/people/1/')
            .then(response => setStarwarsData(response))
            .catch(error => console.log(error))
        )
    }

    useEffect(()=>{
        getDataFromStarWarsAPI()
    },[])


    return (
        <div>
            <h1>SHOP</h1>
            <h1>Name : {starwarsData?.data?.name}</h1>
            <h1>Hair : {starwarsData?.data?.hair_color}</h1>
            <button onClick={()=>console.log(starwarsData)}>Load Star Wars</button>
            <button onClick={()=>console.log(starwarsData)}>Previous</button>
            <button onClick={()=>console.log(starwarsData)}>Load Star Wars</button>



        </div>
    )
}
